						Apic.name = "AnswerPic" + i;
						Option.Apic2.addChild(Apic);
		
						var Zoom = new(lib.MyZoom); //התנהגות להגדלה של תמונה
						if (AnswerNum == 4) {
							Zoom.x = (stageW / AnswerNum * i) - stageW / AnswerNum
						} else if (AnswerNum == 2) {
							Zoom.x = (stageW / 4 * i)
						}
						Zoom.y = 395
						Zoom.name = "ZoomName" + i;
						RemoveZoom.push("ZoomName" + i);
		
